import React from "react";
import Sidebar from "../Sidebar/Sidebar";

const Product = () => {
  return (
    <div className="flex">
      <Sidebar />
      <main className="w-full p-10">
        <h3 className="font-extrabold">Products</h3>
        <div className="product-container w-full"></div>
      </main>
    </div>
  );
};
export default Product;
